import React from 'react'

function Sobre() {
  return (
    <div>
        <h1>Sobre mim</h1>
        <p>Desenvolvedor Web com experiência em React.js, JavaScript, Sql server e consumo de APIs REST. Apaixonado pelo desenvolvimento de componentes reutilizáveis. Também possui experiência em projetos gerenciados por Metodologias Ágeis. Formado em Sistemas de Informação e cursando Especialização em Front-End na Digital House Brasil.</p>
    </div>
  )
}

export default Sobre
